            "Description": "Exclusive: Bassam & Mehdi M - Who Killed The Bosh  Club Vision‚Äôs 7th installment, B.O.S.H, comes from Parisian-based artists and producers Bassam & Mehdi M, who deliver four tracks that musically capture House Music-, Rave and Breaks-influences and smoothly combine them in a coherent construct - additionally, the EP is a continuum of the label‚Äôs sound as it keeps the cosmic, almost spaced-out sound and vibe of the label and puts it in absolute context: the B.O.S.H EP. As the EP title suggests all four tracks are built around some Bosh and have highly intriguing synth lines that evoke a partly nostalgic flair yet have a futuristic note - and maybe it is the combination of both that make Bassam and Mehdi M‚Äôs first collaboration sound like a quintessential piece of music that can be played or universally fit in a set at any time, surely causing the right reactions on the floor. The A2, Who Killed The Bosh, certainly is no exception, a lush bass line is strengthened with a catchy synth-line and pads as both alternate or are commonly played and create a wave shape, meaning the listener is drawn to either the calmer moments or the more forward-going and exciting ones and ultimately to both as Mehdi M and Bassam manage to create music with a holistic approach.   Bassam & Mehdi M's EP B.O.S.H will be released on Club Vision in December, 2021.  Buy the EP: https://deejay.de/Bassam_%26_Mehdi_M_BOSH_CV07_Vinyl__983839  Artist & label information Bassam: https://facebook.com/bassamdistriktparis // https://soundcloud.com/bassam-idbaali // https://instagram.com/bassam_music Mehdi M: https://facebook.com/mehdimmusic // https://soundcloud.com/mehdimann // https://www.instagram.com/mehdim____ Club Vision: https://facebook.com/clubvision11 // https://soundcloud.com/clubvisionrecords // https://instagram.com/club_vision  Visit & follow Torture the Artist at: https://torturetheartist.net https://facebook.com/torturetheartist https://soundcloud.com/torture-the-artist https://instagram.com/torture_the_artist https://twitter.com/TorturingArt https://youtube.com/torturetheartist",
