            "Author": "Dubmission Records",
            "Description": "Download or stream \"Just One More\" by Bluey from https://dubmission.bandcamp.com/album/ocean-unknown or https://smarturl.it/oceanunknown  Taken from \"Ocean Unknown\": https://smarturl.it/oceanunknown  INFO Back in 2000, Golden Bay Records released an album hailed as one of the best New Zealand produced ambient records of the decade.  Featuring a warm, watery womb of sound that leaves you feeling naked and newborn, Bluey relies on the dislocating properties of dub to give a sense of strangeness and space, creating an effect that will have you sinking so deep into the upholstery, you'll need a ladder to climb out!  A journey into all things deep, downbeat and dubby, the album opens with the epic, Rhythm and Sound-esque title track, which has been a crowd favourite every time Bluey has played live. While Just One More and 8m Swell are bouncy breaks numbers, and All The Time In The World and Sticky Pond fuse dub and trance tracks such as Skip'n'Swing show a more funky side.   As Bluey puts it himself, \"the sound cannot be accurately defined by any well known genre. The tracks contain the inherent originality which comes from using modern technology in such an isolated and stunning place as Golden Bay\".  Ocean Unknown is a record to dream and drift to, a lavishly-textured, warm and weightless technological transmission from the heart of the echo chamber. It‚Äôs re-release was long overdue, having been out of print since 2002, and never before available digitally. .  A Dubmission Records release  http://dubmissionrecords.com/ http://dubmission.bandcamp.com/ https://www.instagram.com/dubmissionrecords/ https://www.facebook.com/dubmissionrecords http://www.mixcloud.com/dubmissionrecords/ http://soundcloud.com/dubmissionrecords http://twitter.com/dubmission",
